g2:c.PROCEDURE.g2:a.TEXT:
_gqm-enforce-entry-limit (Q: class gqm-queue {the queue}, Client: class object {client or window})

{Remove excess entries starting with the oldest}

N: integer;
Entry: class gqm-entry;
EntryListSorted, EntryListDeleted: class item-list;
GDALoaded: truth-value;
SevSort: symbol = the symbol _gda-severity-sort;

begin

call gqs-force-input-buffer-into-queue(Q, Client);
create an item-list EntryListSorted;
create an item-list EntryListDeleted;
call gqs-get-collected-items (Q, EntryListSorted, Client);

GDALoaded = call gcc-module-is-loaded (the symbol GDA);
if the gqm-entry-limit-trim-criterion of Q = the symbol SEVERITY and GDALoaded then
    call g2-sort-list (EntryListSorted, false, the function-definition named by SevSort, false, structure (direction: the symbol DESCENDING, allow-other-processing: false)) 
else
    call g2-sort-list (EntryListSorted, false, _gqm-age-sort, false, structure (direction: the symbol ASCENDING, allow-other-processing: false)); 

for N = 1 to (gqs-number-of-collected-items (Q) - the gqm-entry-limit of Q) do
    Entry = the first gqm-entry in EntryListSorted;
    remove Entry from EntryListSorted ;
    insert Entry at the end of EntryListDeleted;
end;

delete EntryListSorted ;
call gqs-remove-items(Q, EntryListDeleted, Client);
delete EntryListDeleted;

end

g2:c.METHOD.g2:a.TEXT:
gqm-entry-constructor (Entry: class gqm-error-entry {a newly-created error entry whose attributes must be populated with data}, Q: class gqm-queue {the queue to which this entry was posted}, EntryData: structure {a structure consisting either of: gqm-text (text) or gqm-error (error)}, Client: class object {window or client object})

{This method extends gqm-entry::gqm-entry-constructor.  For class gqm-error-entry, the gqm-text of <i>EntryData</i> is used if it exists, otherwise this method uses the gqm-error of <i>EntryData</i> to create the text of <i>Entry</i>.}

DateTime, MsgText: text;
DeleteError: truth-value;
TheError: class error;

begin

call next method;
if the gqm-text of EntryData /= "" then 
    MsgText = the gqm-text of EntryData 
else begin
    TheError = the gqm-error of EntryData; {This should be reviewed.  Maybe can make better use of the error structure?}
    DeleteError = (if the gqm-delete-error of EntryData exists then the gqm-delete-error of EntryData else false);
    MsgText = the error-description of TheError;
    if DeleteError then 
        delete TheError;
end;

DateTime = call gqm-time-to-text (the gqm-creation-time of Entry, the symbol DATETIME);
{*** Overrides the text placed there by superior method ***}
conclude that the gqm-message-text of Entry = "[DateTime][_gqm-crlf][MsgText]"; 
conclude that the gqm-source of EntryData is the-gqm-source-of Entry;

end

gqm-save-entry (Entry: class gqm-entry {the entry to save}, Q: class gqm-queue {the queue which is requesting that the entry be saved}, FileName: text {the file to which to save the entry}, Client: class object {client for this call})

{This method is called when the data from an entry is to be saved to a file.  Typically this method would be called from a gqmv-save-selected-button of a view of <i>Q</i>, although gqm-save-entry is also an API function.<p>
To extend this method, you must reopen the file named by <i>FileName</i>, either before or after the 'call next method.'  Alternatively, you could override the format of the logging by writing the data from <i>Entry</i> in your own format, without a 'call next method.'}

TheDate: text;
File: class g2-stream;
IncludeComments: truth-value = true;
LogMgr: class gqm-logging-manager;
N: integer;
SaveText: text;
TheComments: class text-array = the gqm-comments of Entry;

begin

if the gqs-logging-manager of Q /= the symbol UNSPECIFIED then begin
    LogMgr = the gqm-logging-manager named by the gqs-logging-manager of Q;
    IncludeComments = the gqm-log-comments of LogMgr;
end;
 
File = call g2-open-file-for-write (FileName);
{*** Date & Time ***} 
TheDate = call gqm-time-to-text (the gqm-creation-time of Entry, the symbol DATETIME); 
SaveText = "[_gqm-crlf]***** [TheDate] *****[_gqm-crlf]";
call g2-write-line (File, SaveText);
 
{*** Message Text ***}
SaveText = gqm-get-entry-message-text (Entry);
SaveText = "[SaveText][_gqm-crlf]";
call g2-write-line (File, SaveText);
 
{*** Comments -- Saved by default ***}
if IncludeComments and the array-length of TheComments > 0 then begin
    SaveText = call gfr-localize-message (gqm-text-resources, the symbol GQM-COMMENTS, gfr-language (Client), Client);
    SaveText = "----- [SaveText] -----[_gqm-crlf]";
    for N = 0 to the array-length of TheComments - 1 do
        SaveText = "[SaveText][TheComments [N]][_gqm-crlf]";
    end;
    call g2-write-line (File, SaveText);
end;

call g2-close-file (File);
 
end

gqm-delete (Entry: class gqm-entry {The entry to which is to be deleted.}, Client: class object {The client for this call.})
{This is an extensible method to allow for cleanup of gqm-entry subclasses.  Be sure to use 'call next method' to complete the deletion.  Specialized code should precede the 'call next method.'<p>
This procedure should never be called by the application developer.}
begin
    make Entry transient;
    delete Entry;
end

gqm-log-entry (Entry: class gqm-error-entry {the entry to log}, Q: class gqm-queue {the queue}, LogMgr: class gqm-logging-manager {the logging manager for the queue}, Client: class object {client window})
{See gqm-entry::gqm-log-entry for instructions on extending this method.}
LogText, TheDate, ThePriority: text;
N: integer;
TheComments: class text-array;
begin
    TheDate = call gqm-time-to-text (the gqm-creation-time of Entry, the symbol DATETIME);
    ThePriority = call gfr-localize-message (gqm-text-resources, the symbol GQM-PRIORITY, gfr-language (Client), the gqm-priority of Entry, Client);
    LogText = "[TheDate]   [ThePriority][_gqm-crlf]  [the gqm-message-text of Entry][_gqm-crlf][_gqm-crlf]";
    if the array-length of the gqm-comments of Entry > 0 then begin
        TheComments = the gqm-comments of Entry;
        for N = 0 to the array-length of the gqm-comments of Entry - 1 do
            LogText = "[LogText]     [TheComments [N]][_gqm-crlf]";
        end;
        LogText = "[LogText][_gqm-crlf]";
    end;
    call glf-write-to-log-file (LogMgr, LogText, true, Client);
end

gqm-log-entry (Entry: class gqm-entry {The entry to log} {the queue}, Q: class gqm-queue {The queue for which logging is enabled.  Logging occurs on a per queue basis.}, LogMgr: class gqm-logging-manager {The logging manager for <i>Q</i>}, Client: class object {Client or g2-window for the call.})
{This method is called to log a queue-entry.  It is called by the gqm-queue::gqs-recieve-items method if the queue is being logged (see gqm-logging).   The method creates the text of the log entry and then logs it with a call to glf-write-to-log-file.  To override this method, you can create your own log entry text, and then call glf-write-to-log-file.  You should not use 'call next method.'<p>
Before subclassing gqm-entry to extend this method, refer to the documentation on gqm-logging-manager for a discussion on the logging mechanisms.  Also note that this method should generally not be subclassed for gda-alarm-entry.  Instead refer to the gda-alarm-queue-setting attribute gda-alarm-log-formatter.}
LogText: text = "";
MsgText, TheTime: text;
MsgTime: float;
N: integer;
TheComments: class text-array;
begin
    MsgTime = gqm-get-entry-creation-time (Entry);
    MsgText = gqm-get-entry-message-text (Entry);
    TheTime = call gqm-time-to-text (MsgTime, the gqm-time-format of LogMgr);
    LogText = "[LogText][TheTime]: [MsgText][_gqm-crlf][_gqm-crlf]";
    if the array-length of the gqm-comments of Entry > 0 then begin
        TheComments = the gqm-comments of Entry;
        for N = 0 to the array-length of the gqm-comments of Entry - 1 do
            LogText = "[LogText]     [TheComments [N]][_gqm-crlf]";
        end;
        LogText = "[LogText][_gqm-crlf]";
    end;
    call glf-write-to-log-file (LogMgr, LogText, true, Client);
end

gqm-expire-entry (Entry: class gqm-entry {The entry to expire.}, Q: class gqm-queue {The queue to which the entry was posted}, Source: class item {The source item of the entry,if applicable.}, Client: class object {Client or window.})
{Gqm-expire-entry is called from an entry constructor.  The procedure waits for the lifetime specified on the gqm-queue attribute, gqm-entry-lifetime, and then removes <i>Entry</i> from all queues upon which it resides.  Extend this method if you require additional behavior when an entry expires beyond that which takes place which a normal removal.}
DView: class gqmv-view;
UpdateTime: float = the gqs-update-latency of Q;
Queue: class gqm-queue;
QList: class item-list;
begin
    wait for the gqm-entry-lifetime of Q;
    if Entry does not exist then return;
    if there exists a gqmv-view DView that is the-gqmv-detail-view-of Entry then wait until DView does not exist checking every UpdateTime;
    if Entry does not exist or Client does not exist then return; 
    create an item-list QList;
    call gqs-get-queues-containing-item (Entry, QList, Client);
    for Queue = each gqm-queue in QList do
        call gqs-remove-single-item  (Queue, Entry, Client);
    end;
    delete QList;
end

gqm-entry-constructor (Entry: class gqm-entry {A newly created entry whose attributes must be populated with data}, Queue: class gqm-queue {the queue to which <i>Entry</i> is being posted}, EntryData: structure {A structure containing data for <i>Entry</i>.  See gqm-post-entry for a description of this structure)}, Client: class object {The client for this call.})
{Constructs a new gqm-entry by filling in the gqm-message-text, the gqm-creation-time, and the gqm-priority.  The text of the message is obtained from the gqm-text of <i>EntryData</i>.  The gqm-priority is obtained from the gqm-queue attribute, gqm-default-priority.  This method is called from gqm-post-entry with a new entry created by the Queue.  This method should not be called directly.<p>
Extending this method allows an application programmer to initialize additional attributes that exist on a subclass of gqm-entry.  Typically, having more attributes to initialize requires that additional data be passed to the gqm-post-entry call, but data could also come from the entry, the queue or other parts of the system.  Be sure to include 'call next method.'  The 'call next method' line should precede any code which might override the default value of attributes.}
begin
    conclude that the gqm-message-text of Entry = the gqm-text of EntryData;
    conclude that the gqm-creation-time of Entry = the current subsecond time;
    conclude that the gqm-priority of Entry = the gqm-default-priority of Queue;
end

g2:c.PROCEDURE.g2:a.TEXT:
_GQM-create-standard-queue (Queue: class gqm-queue {The queue prototype from which to create new queue}, Client: class ui-client-item {The Client for the call.  If Client is a g2-window, the new queue is attached to the mouse.}) = (class gqm-queue {A newly created queue, based on the defaults for the class.  Specifically, all attributes are the default attributes for the class of queue except the following:<br>
    <i>Gqs view template or access table, 
    Gqs view template or access table
    Gqm entry class </i><br>
    These are copied from the input queue, Queue.})
{Creates a new queue, based on the gfr-create-instance-using-palette-method.}
NewQueue: class gqm-queue;
TargetClass: symbol = the class of Queue;
begin
    NewQueue = call gfr-create-instance-using-palette-method (TargetClass, Client);   
    conclude that NewQueue is gfr-item-to-be-made-permanent NewQueue;
    conclude that Client is _gfr-window-of-new-palette-clone NewQueue;
    conclude that the gqs-view-template-or-access-table of NewQueue = the gqs-view-template-or-access-table of Queue;    
    conclude that the gqs-logging-manager of NewQueue = the gqs-logging-manager of Queue;
    conclude that the gqm-entry-class of NewQueue = the gqm-entry-class of Queue;
    if Client is a g2-window then begin
        transfer NewQueue to the mouse of Client;
    end else inform the operator that "No method to create a Queue on a non-g2 window has been defined";
    return NewQueue;
end

