g2:c.PROCEDURE.g2:a.TEXT:
gqm-get-queue-names () = (sequence {A sequence of symbols, the queue names.})
{Returns a sequence of the names of every instance of gqm-queue (or subclass) within the application.}
Q: class gqm-queue;
S: sequence = sequence ();
begin
    for Q = each gqm-queue do
        if Q has a name then S = insert-at-end (S, the name of Q);
    end;
    return S;
end

_gqm-delete-on-removal (EntrySequence: sequence, Client: class object)

QueueList: class item-list;
Queue: class gqm-queue;
Entry: class gqm-entry;

begin
    create an item-list QueueList;
    for Entry = each gqm-entry in EntrySequence do
        call gqs-get-queues-containing-item (Entry, QueueList, Client);
        if the number of elements in QueueList = 0 then
            call gqm-delete (Entry, Client)
        else for Queue = each gqm-queue in QueueList do
            remove Queue from QueueList;
        end;
    end;
    delete QueueList 
end

g2:c.METHOD.g2:a.TEXT:
gqs-receive-items (Q: class gqm-queue {the queue receiving items}, Sender: item-or-value {Typically false.  Not used by this subclass}, Entries: class item-list {A list of the new entries to be added to the queue}, Client: class object {the client for this call})
{GQM extends the GQS behavior by adding three functions.<p>  First, if the gqm-queue is set up to be logging entries, the entry is logged.  This is done by making a call to the method gqm-log-entry on the class of the entry received.<p>
    Second, the procedure will compare number of items that the queue will have at the end of the receiving process with the limit set for the queue in gqm-entry-limit.  If the limit is exceeded, the entries will be forced into the queue and the oldest entries thrown out<p>
    Finally, if the gqm-messages-display for <i>Q</i> is true, the receipt of new entries will launch a new view on any Client which does not already have a view.  Note that this means if an queue exists, but is hidden behind other workspaces, it will not be shown<p>}

Entry: class gqm-entry;
LogMgr: class gqm-logging-manager;
EachClient: class {ui-client-item} g2-window;

begin
    call next method;
    if gqm-logging (Q) then begin
        LogMgr = the gqm-logging-manager named by the gqs-logging-manager of Q;
        for Entry = each gqm-entry in Entries do
            call gqm-log-entry (Entry, Q, LogMgr, Client);
        end;
    end;
    if the gqm-display-messages of Q is true then begin
        for EachClient = each g2-window {ui-client-item} do
            if the g2-connection-status {ui-client-connection-status} of EachClient = the symbol CONNECTED then begin
                if EachClient is a g2-window and the gqm-beep-for-new-entry of Q is true then call g2-beep (EachClient);
                call gevm-launch-view (Q, EachClient);
            end;
        end;
    end;
    if gqs-number-of-collected-items(Q) + the number of elements in Entries > the gqm-entry-limit of Q then call _gqm-enforce-entry-limit (Q, Client); {This check is made last, because it may force the new entries into the queues.}
end

gqs-remove-items (Queue: class gqm-queue {the queue containing items to be removed}, Items: class item-list {a list of items to be removed from Queue}, ClientObj: class object {the client for this call})
{The GQM version of this method actually deletes the entry objects upon removal, assuming the object is not currently residing on another queue.  The deletion is carried out in a separate thread.  This allows any updating of queues which is to take place in the current thread to complete before the actual deletions occur.}
begin

    call next method;
 
    start _gqm-delete-on-removal (the g2-list-sequence of Items, ClientObj);
end

gqs-send-items (Sender: class gqm-queue {the item responsible for sending items to the receiving queue}, Receiver: class gqs-queue {the queue receiving the items in SendList}, SendList: class item-list {the list of items to be added to the receiving queue}, Client: class object {the client for this call})
CompatibleEntryClasses, ErrorClass: truth-value;
SenderEntryList: class item-list;
Entry: class gqm-entry;

{This procedure is customized for the gqm-queues so that compatible types are insured when sending entries from one queue to another}
begin
    CompatibleEntryClasses = call _gqm-isa (the gqm-entry-class of Sender, the gqm-entry-class of Receiver);
    ErrorClass = call _gqm-isa (the gqm-entry-class of Receiver, the symbol GQM-ERROR-ENTRY);  {Error queue cannot receive sent messages}
    if CompatibleEntryClasses  and not (ErrorClass) then begin
        call gqs-receive-items (Receiver, Sender, SendList, Client);
        call gqs-force-input-buffer-into-queue (Receiver, Client);
    end else begin
        call _gqm-alert (gqm-text-resources, the symbol GQM-INCOMPATIBLE-ENTRIES, Client);
        create an item-list SenderEntryList;
        call gqs-get-collected-items (Sender, SenderEntryList, Client);
        for Entry = each gqm-entry in SenderEntryList do
            if Entry is a member of SendList then remove Entry from SendList;
        end;
        call gqs-receive-items(Sender, Sender, SendList, Client);
        call gqs-force-input-buffer-into-queue(Sender, Client);
        delete SenderEntryList;
    end;
end

gqm-post-entry (Q: class gqm-queue {the target queue}, EntryData: structure {A structure which has, in the case of the gqm-queue, an attribute: gqm-text (text - the text of the message) - subclasses may have more elements}, Client: class object {window or client object}) = (class gqm-entry {the newly created entry})

{--- Creates a new entry of the class specified by the gqm-entry-class of the queue.  This entry is initialized via its gqm-entry-constructor method and then posted to the Queue.  The new entry is returned. ---}

Entry: class gqm-entry;

begin

create an instance Entry of the class named by the gqm-entry-class of Q;
call gqm-entry-constructor (Entry, Q, EntryData, Client);
conclude that the gevm-key of Entry = the UUID of Entry;
call gqs-receive-single-item (Q, Entry, Client);
return Entry;

end

g2:c.PROCEDURE.g2:a.TEXT:
_gqm-isa (Sub: symbol, Super: symbol) = (truth-value)

S: symbol;
TV: truth-value;

begin
    if Sub = Super then
        return true;
    for S = each symbol that is an inferior-class of Super do
        if Sub = S then return true;    {*** Direct descendant ***}
        TV = call _gqm-isa (Sub, S);    {*** Indirect descendant ***}
        if TV then return true;
    end;
    return false;
end

