g2:c.PROCEDURE.g2:a.TEXT:
gqm-default-ordination (ANumber: integer {the number}) = (text {the ordinal})
{Returns an ordinal as text given an integer.  For example, an input of '1' returns '1st,' an input of '2' returns '2nd,' and so forth.  This procedure also handles the english peculiarities of '11', '12', and '13'.<p>
This procedure is also callable as an API to generate ordinal texts as part of your code.}
Len: integer;
LastChar, LastPair, Suffix: text;
NText: text = "[ANumber]";
begin
    Len = length-of-text (NText);
    LastChar = get-from-text (NText, Len, Len);
    if Len > 1 then begin {*** Exceptions ***}
        LastPair = get-from-text (NText, Len - 1, Len);
        if LastPair = "11" or LastPair = "12" or LastPair = "13" then return "[NText]th";
    end;
    case (LastChar) of
        "1": Suffix = "st";
        "2": Suffix = "nd";
        "3": Suffix = "rd";
        otherwise: Suffix = "th";
    end;
    return "[NText][Suffix]";
end

gqm-time-to-text (UserTime: float {the G2 time}, Form: symbol {a symbol that can be one of: DATE, TIME, DATETIME, FILETIME (a format that is suitable for use in filenames requiring a date-time segment) }) = (text {the formatted time})
{Returns a formatted time given a time and format. These formats can be edited in the gqm-general-setting preference (configured via Preferences > Queues > General Settings).  This procedure is callable if you need to obtain a formatted text string from a G2 time and you wish it to be configured as in the gqm-general-setting.}
GenSetting: class gfr-module-setting;
NewText, OldText, ErrorText: text;
Result: text;
StartSeg, EndSeg, Len, H, DayNum: integer;
Win: class g2-window = gfr-default-window;
TheTime: integer;
begin
    GenSetting = call gfr-get-active-setting (the symbol GQM-GENERAL-SETTING, win);
    case (Form) of
        DATETIME: Result = the gqm-date-time-format of GenSetting;
        DATE: Result = the gqm-date-format of GenSetting;
        FILETIME: Result = the gqm-file-time-format of GenSetting;
        TIME: Result = the gqm-time-format of GenSetting;
        otherwise: begin
            ErrorText = call gfr-localize-message (gqm-text-resources, the symbol GQM-INVALID-DATE-TIME-SEGMENT, gfr-language (win), win);
            signal the symbol GQM-INVALID-DATE-TIME-SEGMENT, ErrorText;
        end;
    end;
    repeat
        TheTime = round (UserTime);
        StartSeg = position-of-text ("<", Result);
        exit if StartSeg = 0;
        EndSeg = position-of-text (">", Result);
        exit if EndSeg = 0;
        OldText = get-from-text (Result, StartSeg, EndSeg);
        Len = length-of-text (OldText);
        case (OldText) of
            "<y2>": NewText = omit-from-text ("[year (TheTime)]", 1, 2);
            "<y4>": NewText = "[year (TheTime)]";
            "<m>": NewText = "[month (TheTime)]";
            "<m2>": begin
                NewText = "[month (TheTime)]";
                if length-of-text (NewText) = 1 then NewText = "0[NewText]";
            end;
            "<mf>": NewText = call gfr-localize-message (gqm-text-resources, gqm-get-month-key (month (TheTime)), gfr-language (win), win);
            "<ma>": begin
                NewText = call gfr-localize-message (gqm-text-resources, gqm-get-month-key (month (TheTime)), gfr-language (win), win);
                NewText = get-from-text (NewText, 1, 3);
            end;
            "<d>": NewText = "[day-of-the-month (TheTime)]";
            "<d2>": begin
                NewText = "[day-of-the-month (TheTime)]";
                if length-of-text (NewText) = 1 then NewText = "0[NewText]";
            end;
            "<dor>": begin
                DayNum = day-of-the-month (TheTime);
                NewText = call the procedure named by the gqm-ordination-procedure of GenSetting (DayNum);
            end;
            "<df>": NewText = call gfr-localize-message (gqm-text-resources, day-of-the-week (TheTime), gfr-language (win), win);
            "<da>": begin
                NewText = call gfr-localize-message (gqm-text-resources, day-of-the-week (TheTime), gfr-language (win), win);
                NewText = get-from-text (NewText, 1, 3);
            end;
            "<apm>": begin
                H = hour (TheTime);
                if H > 11 then NewText = "P.M."
                else NewText = "A.M.";
            end;
            "<h12>": begin
                H = hour (TheTime);
                if H > 12 then H = H - 12
                else if H = 0 then H = 12;
                NewText = "[H]";
            end;
            "<h24>": begin
                NewText = "[hour (TheTime)]";
                if length-of-text (NewText) = 1 then NewText = "0[NewText]";
            end;
            "<min>": begin
                NewText = "[minute (TheTime)]";
                if length-of-text (NewText) = 1 then NewText = "0[NewText]";
            end;
            "<sec>": begin
                NewText = "[second (TheTime)]";
                if length-of-text (NewText) = 1 then NewText = "0[NewText]";
            end;
            otherwise: NewText = get-from-text (OldText, 2, Len - 1);
        end;
        Result = omit-from-text (Result, StartSeg, EndSeg);
        Result = insert-in-text (NewText, Result, StartSeg);
    end;
    return Result;
end
